import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Dashboard from "./components/Dashboard";

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Dashboard />} />
                <Route path="/exercise/chest" element={<h1>Chest Exercises</h1>} />
                <Route path="/exercise/back" element={<h1>Back Exercises</h1>} />
                <Route path="/exercise/legs" element={<h1>Leg Exercises</h1>} />
                <Route path="/exercise/arms" element={<h1>Arms Exercises</h1>} />
                <Route path="/exercise/shoulders" element={<h1>Shoulders Exercises</h1>} />
            </Routes>
        </Router>
    );
}

export default App;
